import "./styles.css";

class App extends Component {
  render() {
  return (
    <div className="App">
      <h1>Hello World</h1>
      <FirstComponent />
    </div>
  );
  }
}

class FirstComponent extends Component{
  render(){
    return (
      <div>
        <h1>First Component</h1>
      </div>
    )
  }
}

export default App;
